(1490, 'Zoom', '2024-09-14', 985, NULL, 'Lakeza stayed the full duration (4-6pm). She has given the pre-test last week, and taught Computing Needs All Voices to her I.T. class on the week after Labor Day. She plans to review everything this weekend, and begin Order of Operations next week with her Algebra 1 classes. Last week was full of testing, so she ended with a fun activity on Friday. The students had to identify ways to have four 2s and put operators to get answers (like 0 or 9). She thinks this fun lesson Friday gives a great introduction into her next unit on Order of Operations. Her next unit will be functions, so she asked if Bootstrap should be taught before, during, or after. I suggested teaching contracts BEFORE so you could have fun with image functions to use the domain/range vocabulary, BEFORE talking about it with numbers and word problems.'),
